import "./Expenses.css";
import ExpenseItem from "./components/ExpenseItem";

const Expenses = () => {
  return (
    <div className="expenses">
      <ExpenseItem
        nameOfProduct={expenses[0].title}
        price={expenses[0].amount}
        date={expenses[0].date}
        azania="lethal"
      ></ExpenseItem>
      <ExpenseItem
        nameOfProduct={expenses[1].title}
        price={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        nameOfProduct={expenses[2].title}
        price={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        nameOfProduct={expenses[3].title}
        price={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
    </div>
  );
};

export default Expenses;
